import React from 'react';

function AdviceCard({ advice, generateAdvice }) {
  return (
    <div className="advice-card">
      <p>{advice}</p>
      <button onClick={generateAdvice}>Новый совет</button>
    </div>
  );
}

export default AdviceCard;
